query:
fragment AppFragment on App {
  id
  name
  created
  isActive
  type
  homepageUrl
  appUrl
  configurationUrl
  supportUrl
  version
  accessToken
  privateMetadata {
    key
    value
    __typename
  }
  metadata {
    key
    value
    __typename
  }
  tokens {
    authToken
    id
    name
    __typename
  }
  webhooks {
    ...WebhookFragment
    __typename
  }
  __typename
}

fragment WebhookFragment on Webhook {
  id
  name
  isActive
  app {
    id
    name
    __typename
  }
  __typename
}

query App($id: ID!) {
  app(id: $id) {
    ...AppFragment
    aboutApp
    permissions {
      code
      name
      __typename
    }
    dataPrivacy
    dataPrivacyUrl
    __typename
  }
}
